import { Component } from "react";
import { Col, Row } from "react-bootstrap";

class FirstGallery extends Component {
  componentDidMount() {
    fetch("http://www.omdbapi.com/?i=tt3896198&apikey=8034813b&t=batman")
      .then((response) => {
        if (!response.ok) {
          throw new Error("Errore nella fetch");
        }
        return response.json();
      })
      .then((data) => {
        console.log(data);
      })
      .catch((error) => {
        console.error("Errore durante il recupero dei dati del film:", error);
      });
  }

  render() {
    return (
      <>
        <h3 class="mb-4">Trending Now</h3>
        <Row class="row">
          <Col class="col-6 col-md-4 col-lg mb-4">
            <div class="border-0">
              <img
                src="/Netflix-assets/assets/media/media0.webp"
                class="w-max-100"
                alt="sherlock"
                draggable="false"
              />
            </div>
          </Col>
        </Row>
      </>
    );
  }
}

export default FirstGallery;
